def most_frequent_greater_than_10(lst):
    greater_than_10 = [num for num in lst if num > 10]
    frequency = {}
    for num in greater_than_10:
        if num not in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
    most_frequent = max(frequency, key=frequency.get)
    return most_frequent

